import React, { useState, useEffect } from 'react';
import axios from 'axios';

const MyVilla = () => {
  const [villaData, setVillaData] = useState(null); // 초기값을 null로 설정

  useEffect(() => {
    const fetchVillaData = async () => {
      try {
        const response = await axios.get('http://localhost:3001/api/villa/your-villa-id'); // 실제 villa ID를 사용하세요
        setVillaData(response.data);
      } catch (error) {
        console.error('Error fetching villa data:', error);
      }
    };

    fetchVillaData();
  }, []);

  if (!villaData) {
    return <div>Loading...</div>; // villaData가 아직 로드되지 않은 경우 로딩 표시
  }

  return (
    <div>
      <h2>{villaData.villaName}</h2>
      <p>{villaData.address}</p>
      {villaData.spaces && villaData.spaces.length > 0 ? ( // spaces가 존재하고 배열일 경우만 렌더링
        <div>
          {villaData.spaces.map((space, index) => (
            <div key={index}>
              <p>Type: {space.type}</p>
              <p>Location: ({space.left}, {space.top})</p>
              <p>Size: {space.width}x{space.height}</p>
            </div>
          ))}
        </div>
      ) : (
        <p>No spaces available.</p>
      )}
    </div>
  );
};

export default MyVilla;
